import './App.css';
import React, { Component } from 'react'

class App extends Component {

  url = 'http://localhost:8080/user/alex'
  name = ''
  state = {
    users: []
  }

  addUser() {
    fetch(this.url, {method: 'POST'})
    .then(res => res.json())
    .then((data) => {
      this.setState({users: [...this.state.users, data]})
      this.render()
    })
    .catch(console.log)
  }

  render() {
    return (
      <div className="App-header">
        <button onClick={this.addUser.bind(this)}>
          Add user
        </button>
        {this.state?.users.map((user, i) => <div key={i}> {user.id} </div>)} 
      </div>
    )
  }
}

export default App;
